“If you’re silent about your pain, they’ll kill you and say you enjoyed it!” - Zora Neale Hurston

Today, we are breaking our silence and sharing our stories about Birthing While Black in Georgia. Georgia has one of the highest maternal mortality rates in the country, making it one of the most dangerous states to give birth in, especially if you’re a Black mama. Black mamas in Georgia are dying in childbirth at twice the rate as white women, because they don’t have the resources and services they need to have healthy and safe birth experiences. 

@newgeorgiaproject’s Black M.A.M.A.S. Campaign is committed to ensuring the lives of Black women are prioritized just as other women are. In 2024, we’re organizing for more birth centers, increased doula and midwife care, and other services that will make Birthing While Black in Georgia safer. This year is a major election year, y’all, and Georgia’s legislative session starts on January 8th, which means our work begins now! Join our campaign and fight for birth justice in Georgia at ngp.org/blackmamas. Click the link in our bio to watch the full video. 

